    // Conditionally attach different CSS classes here

    return(
        <div className={ classes.SideDrawer }>
            <div className={ classes.Logo }>
                <Logo />
            </div>
            <nav>
                <NavigationItems />
            </nav>
        </div>
    );
}

export default sideDrawer;
